require 'faker'
require_relative '../models/user'
require_relative '../models/doodle'

module Generator
  # Fill the database with Users and associated posts and secret links (hash_urls)
  def self.fake_data(num)
  	num.times do
      temp = User.create!({username:Faker::Internet.user_name, email:Faker::Internet.email, password_hash:'1234'})
      temp.doodles.create!({doodle_data: @img})
  	end
  end

  # Just create fake users
  def self.fake_users(num)
  	num.times do
      User.create!({username:Faker::Internet.user_name, email:Faker::Internet.email, password_hash:'1234'})
  	end
  end

  # Just create fake posts and associated secret links (hash_urls)
  def self.fake_doodles(num)
  	num.times do
      Doodle.create!({doodle_data: @img, user_id: Random.rand(num)})
  	end
  end

  #Drops the submitted database table.  No argument will clear all tables
  def self.drop_fake_data(table_name)

  end

  @img = 'data:image/png;base64,'


end
